// 导入日期选择器组件
import juiQrcode from './qrcode/index.js'
import { SkuTable,SkuSpec } from './sku/index.js'

// 存储组件列表
const components = [
  juiQrcode,
  SkuTable,
  SkuSpec,
  ];

// 定义 install 方法，接收 Vue 作为参数。如果使用 use 注册插件，则所有的组件都将被注册
const install = function (Vue) {
  // 判断是否安装
  if (install.installed) return
  // 遍历注册全局组件
  components.map(component => Vue.component(component.name, component))
}

// 判断是否是直接script引入文件
if (typeof window !== 'undefined' && window.Vue) {
  install(window.Vue)
}


export default {
  // 导出的对象必须具有 install，才能被 Vue.use() 方法安装
  install,
  // 以下是具体的组件列表
  ...components
}

export {
  juiQrcode,
  SkuTable,
  SkuSpec,
}
